import React, { Component } from "react";
import axios from "axios";
import { Redirect, withRouter } from "react-router-dom";

class addDates extends Component {
    constructor(props) {
        super(props);

        this.state = {
            datetimes: undefined,
        }
    }



    addDate = (e) => {
        var monday = new Date();
        monday = monday.getFullYear() + '-' + monday.getMonth() + '-' + (monday.getDate() + 1);

        axios.post('http://localhost:1337/dates/', {
            date: monday,
            time: "17:00:00.000",
            TicketsLeft: 25,
        }).then((rest) => { console.log("yay: " + rest) })
    }


    render() {

        if (this.props.aUserGroup != "admin") {
            return (<Redirect to="/" />)
        }
        return (
            <div className={"addFormMain"}>
                <div className={"addFormWrapper"}>
                    <div className={"addFormContainer"}>
                        <form className={"addForm"} onSubmit={this.onSubmitHandle.bind(this)}>
                            <div>Vilka datum?</div>
                            <div className={"addFormInput"}>
                                <select>
                                    <option>

                                    </option>
                                </select>
                            </div>
                            <div className={"addFormButtonDiv"}>
                                <button type="submit" className={"addFormButton"}>Save</button>
                            </div>
                        </form>
                    </div>
                </div>
            </div >
        )
    }
}

export default addDates;
